import React from 'react';
import './Header.css';

export default class Header extends React.Component {
  render() {
    return (
      <header className='header'>
        <p className='pp' onClick={this.props.Den}></p>
        <p className='ppp' onClick={this.props.Ben}></p>
        <div>
          <h1>{this.props.st}</h1>
        </div>
      </header>
    );
  }
}
